INSERT INTO `privacy` (`id`, `description`, `created_at`, `updated_at`) VALUES
(1, '<p>Ai sensi dell&rsquo;art. 13 del Regolamento UE 679/2016 sulla protezione dei dati personali L&rsquo;azienda Star 9000 Srl (di seguito &ldquo;Star9000&rdquo;) in qualit&agrave; di Titolare del trattamento&egrave; impegnata nella protezione dei dati personali che le vengono affidati conformemente a quanto richiesto dal Regolamento Generale Europeo 679/2016 per la protezione dei dati personali (di seguito&ldquo;GDPR&rdquo;). In considerazione del fatto che sin dall&rsquo;accettazione presso la nostra struttura sanitaria, Star 9000 verr&agrave; in possesso di numerose informazioni che la riguardano, sia di natura anagrafica che sanitaria, con la presente verranno esposte le modalit&agrave; e le finalit&agrave; con le quali verranno trattate le predette informazioni e che per questi motivi &egrave; invitato a leggere con attenzione.Tutte le informazioni saranno trattate con la massima riservatezza secondo i principi di necessit&agrave;, sicurezza e responsabilit&agrave; disciplinati dalla vigente normativa in materia di protezione dei dati personali, oltre che nel pi&ugrave; rigoroso rispetto del segreto professionale che vincola il personale sanitario e amministrativo di questa struttura.</p>\r\n<h2>Dati identificativi</h2>\r\n<p>1. Titolare del trattamento: Star 9000 Srl con sede in via Rodi 27, Brescia c.f. /p.iva 03386790178. 2. Responsabile trattamento dei dati personali: Dott. Filippo Scuri 3. Responsabile per la protezione dei dati personali: DPO 4. Dati di contatto: a) telefono 030 2420273; b) emailinfo@star9000.it;c) fax0302428117.</p>\r\n<h2>Oggetto del trattamento</h2>\r\n<p>Star 9000 tratta i dati personali (ad esempio, nome, cognome, codice fiscale, ragione sociale, indirizzo, telefono, e-mail, riferimenti bancari e di pagamento), e potr&agrave; trattare, previo consenso dell&rsquo;interessato e in ossequio ai provvedimenti dell&rsquo;Autorit&agrave; garante per la protezione dei dati personali, dati idonei a rivelare lo stato di salute e i cosiddetti &ldquo;dati particolari&rdquo; (ad esempio esiti degli esami, fascicoli sanitari, diagnosi, anamnesi, cure svolte). Per trattamento di dati personali si intende qualsiasi operazione o insieme di operazioni, compiute con o senza l\'ausilio di processi automatizzati e applicate a dati personali o insiemi di dati personali, anche se non registrati in una banca di dati, come la raccolta, la registrazione, l\'organizzazione, la strutturazione, la conservazione, l\'elaborazione, la selezione, il blocco, l\'adattamento o la modifica, l\'estrazione, la consultazione, l\'uso, la comunicazione mediante trasmissione, la diffusione o qualsiasi altra forma di messa a disposizione, il raffronto o l\'interconnessione, la limitazione, la cancellazione o la distruzione.</p>\r\n<h2>Finalit&agrave; del trattamento</h2>\r\n<p>Star 9000utilizzer&agrave; i suoi dati esclusivamente per le seguenti finalit&agrave;: 1. Erogazione delle prestazioni e degli interventi di prevenzione, diagnosi e cura (ivi incluse le attivit&agrave; di follow-up a fini di cura, le visite specialistiche e/o le prestazioni ambulatoriali);&nbsp; 2. Costituzione e consultazione di un Fascicolo/Dossier sanitario elettronico funzionale al miglioramento dei processi di cura; 3. Gestione degli adempimenti amministrativo-contabili nei limiti necessari per la corretta elaborazione contabile e per il pagamento delle prestazioni sanitarie (da parte di Compagnie Assicurative, Associazioni, Enti,Mutue Integrative); 4. Gestione di attivit&agrave; amministrative connesse e strumentali alle prestazioni e ai servizi sanitari; 5. Adempimento di specifici obblighi o esecuzione di specifici compiti previsti da leggi, dalla normativa comunitaria o da regolamenti, in particolare in materia di diagnosi e cura, di profilassi delle malattie infettive e diffusive, di assistenza farmaceutica, in conformit&agrave; alla legge; 6. Attivit&agrave;di ricerca scientifica/statistica con trattamento dei dati in&nbsp;forma anonima ed aggregata; 7. Trattamentidi dati in forma anonima per finalit&agrave; statistico-epidemiologici con relativo follow-up di conoscenza scientifica; 8. Per far valere o difendere, anche da parte di un terzo, un diritto in sede giudiziaria nonch&eacute; in sede amministrativa e nelle procedure di arbitrato e di conciliazione nei casi previsti dalle leggi, dalla normativa comunitaria, dai regolamenti e dai contratti collettivi, sempre che i dati siano trattati esclusivamente per tali finalit&agrave; e per il periodo strettamente necessario; 9. Eventuali dati genetici potranno essere trattati per sole finalit&agrave; di prevenzione, diagnosi, terapia, o per consentire all&rsquo;interessato una decisione libera ed informata nonch&eacute; per finalit&agrave; probatorie in sede civile e penale in conformit&agrave; della legge; 10. Sottoscrizione documenti e contratti mediante firma grafometrica. Il conferimento dei dati &egrave; facoltativo, si precisa per&ograve; che con riferimento alle finalit&agrave; di cui ai punti 1, 3, 4, 5 e 8 in mancanza dei dati personali che la riguardano e del relativo consenso al trattamento, la prestazione non potr&agrave; essere effettuata. Il mancato conferimento per le finalit&agrave; di cui ai punti 2, 6,7, 9e 10 non avr&agrave;, invece, alcuna conseguenza sull&rsquo;erogazione delle prestazioni richieste. Il mancato conferimento del consenso alla comunicazione dei dati idonei a rivelare lo stato di salute a terzi soggetti espressamente delegati dall&rsquo;interessato non consentir&agrave; a Star 9000 la divulgazione e il ritiro della sua documentazione sanitaria.</p>\r\n<h2>Base giuridica del trattamento</h2>\r\n<p>La base giuridica del trattamento dei dati personali riguarda i seguenti punti: Il suo specifico consenso per quanto concerne le finalit&agrave; di: erogazione delle prestazioni e degli interventi di prevenzione, diagnosi e cura/costituzione e consultazione di un Fascicolo/Dossier sanitario elettronico. La necessit&agrave; di adempiere ad un obbligo legale al quale &egrave; soggetto il Titolare per la finalit&agrave; di adempimento di specifici obblighi o esecuzione di specifici compiti previsti da leggi, dalla normativa comunitaria o da regolamenti (art. 6, co. 1, lett. c), GDPR). Ove si tratti di speciali categorie di dati (nello specifico, dati relativi allo stato di salute e/o dati genetici), il trattamento per la suddetta finalit&agrave; &egrave; necessario, in funzione delle attivit&agrave; di diagnosi, assistenza e/o terapia sanitaria a lei fornite e/o da fornire, nonch&eacute; per la gestione dei sistemi e servizi sanitari sulla base del diritto italiano in tale ambito (art. 9, comma 2, lettera h) GDPR). Relativamente a qualsiasi finalit&agrave; sopra indicata, il trattamento dei dati potrebbe comunque rendersi necessario per accertare, esercitare o difendere un diritto in sede giudiziaria, qualora dovessero insorgere contenziosi riguardanti il rapporto intercorso con il Titolare, nei quali possono rilevare le categorie di dati sopra indicate anche di natura sensibile e/o rientranti nelle speciali categorie di dati (art. 9, co. 1, lettera f), GDPR).</p>\r\n<h2>Modalit&agrave; del trattamento</h2>\r\n<p>Per le finalit&agrave; indicate potranno aver luogo operazioni di raccolta, registrazione, conservazione e modificazione dei dati in forma cartacea, informatizzata e telematica con logiche strettamente correlate alle finalit&agrave; stesse, e comunque, sempre nel rispetto delle disposizioni normative atte a garantire, tra l&rsquo;altro, la riservatezza e la sicurezza dei dati.I dati personali conferiti saranno altres&igrave; trattati nel rispetto del principio di liceit&agrave;, correttezza, pertinenza, e non eccedenza. Il trattamento dei dati personali avviene mediante supporto cartaceo e di strumenti elettronici o automatizzati, questi ultimi organizzati in modo da garantire la sicurezza e riservatezza dei dati personali. Gli archivi dei dati sono protetti da una serie di misure organizzative e tecniche idonee, unitamente alla protezione con codici di accesso individuali, ad impedire intrusioni esterne e accessi non autorizzati. Il trattamento avverr&agrave; da parte degli operatori dell&rsquo;azienda espressamente nominati persone autorizzate al trattamento (cosiddetti &ldquo;incaricati del trattamento&rdquo;) opportunamente istruiti anche sulle misure di sicurezza da adottare e sottoposti a costante vigilanza del titolare del trattamento e/o del responsabile interno del trattamento. Al momento dell&rsquo;utilizzo della firma grafometrica verr&agrave; richiesto di apporre alcune firme su un apposito tablet in grado di acquisire, oltre all&rsquo;immagine della sottoscrizione, anche una serie di informazioni relative alle caratteristiche comportamentali a contenuto biometrico (quali la posizione, il tempo, la pressione, la velocit&agrave; e l&rsquo;accelerazione, di seguito, complessivamente, i &ldquo;dati grafometrici&rdquo;) del suo segno grafico. I dati grafometrici verranno criptati, racchiusi e sigillati elettronicamente all&rsquo;interno del documento informatico cui si riferiscono, con programmi tali da garantire la sicurezza e la privacy del firmatario. In particolare, i predetti programmi permetteranno di conoscere esclusivamente l&rsquo;immagine della firma, senza la possibilit&agrave; di accedere o in qualsiasi modo utilizzare i dati grafometrici in chiaro. I dati grafometrici verranno criptati e racchiusi elettronicamente all&rsquo;interno del documento informatico cui si riferiscono, al solo fine di garantire una connessione univoca tra la firma apposta in forma elettronica sul documento ed il suo autore, assicurando cos&igrave; l&rsquo;integrit&agrave; e l&rsquo;immodificabilit&agrave; del documento sottoscritto. In nessun caso saranno derivate informazioni relative allo stato di salute degli interessati, ed i dati grafometrici non saranno accessibili &ldquo;in chiaro&rdquo; n&eacute; al titolare n&eacute; a qualsiasi altro soggetto responsabile o incaricato del trattamento, se non su espressa richiesta dell&rsquo;Autorit&agrave; Giudiziaria. Le chiavi private di accesso ai dati grafometrici saranno conservate da uno o pi&ugrave; soggetti terzi appositamente nominati Responsabili che ne permetteranno l&rsquo;utilizzo esclusivamente nei casi previsti dalla legge e su richiesta delle Autorit&agrave; competenti. Il conferimento dei dati per tale finalit&agrave; (utilizzo firma grafometrica) ed il mancato consenso comporter&agrave; l&rsquo;impossibilit&agrave; di utilizzare la firma grafometrica. Il mancato rilascio dei dati o del consenso da parte del firmatario non comporta pregiudizio alcuno rispetto la finalit&agrave; principale di esecuzione dei servizi. La sottoscrizione dei documenti relativi ai servizi forniti continuer&agrave; quindi ad essere effettuata su supporto cartaceo. Nessuno dei dati grafometrici sopra menzionati sar&agrave; oggetto di diffusione.</p>\r\n<h2>Accesso ai dati</h2>\r\n<p>I suoi dati potranno essere resi accessibili per le finalit&agrave; sopraindicate: a dipendenti e collaboratori del Titolare nella loro qualit&agrave; di incaricati e/o responsabili interni del trattamento e/o amministratori di sistema; a societ&agrave; terze o altri soggetti (a titolo indicativo, istituti di credito, studi professionali, consulenti) che svolgono attivit&agrave; in outsourcing per conto del Titolare, nella loro qualit&agrave; di responsabili esterni del trattamento.</p>\r\n<h2>Fascicolo/dossier sanitario</h2>\r\n<p>Per migliorare il suo processo di cura e quindi per finalit&agrave; di prevenzione, diagnosi, cura e riabilitazione vi &egrave; la possibilit&agrave; previo suo espresso consenso, di costituire un fascicolo/dossier sanitario in forma digitale che documenti la sua storia sanitaria. Le informazioni anagrafiche e sanitarie raccolte potranno cos&igrave; essere tempestivamente aggiornate e rendersi subito disponibili per personale medico della struttura che nel prenderla in cura potr&agrave; accedere a tale strumento. Il consenso alla consultazione del fascicolo o dossier in favore di un determinato soggetto (es. personale medico) pu&ograve; essere riferito anche al suo sostituto. Il mancato consenso totale o parziale non incide sulla possibilit&agrave; di accedere alle cure mediche richieste, mentre in caso di manifestazione del consenso all&rsquo;istituzione del fascicolo/dossier sanitario le sar&agrave; possibile richiedere l&rsquo;oscuramento di specificati eventi clinici e quindi non far comparire nello stesso un singolo episodio di cura.Tale possibilit&agrave; viene garantita al momento della nascita dell&rsquo;evento clinico e potr&agrave; essere esercitata previa richiesta, da parte sua, dell&rsquo;apposita modulistica al personale medico e/o infermieristico di Struttura. Il Fascicolo/Dossier potrebbe essere consultato senza il suo consenso, ma nel rispetto dell&rsquo;Autorizzazione Generale del Garante ad oggi vigente, solo qualora sia indispensabile per la salvaguardia della salute di un terzo o della collettivit&agrave;. L&rsquo;accesso al Fascicolo/Dossier sar&agrave; circoscritto al periodo di tempo indispensabile per espletare le operazioni di cura&nbsp;per le quali &egrave; abilitato il soggetto che accede. Fermi rimanendo i diritti di cui agli artt. 16 e seguenti del GDPR, da farsi valere, relativamente ai dati trattati mediante costituzione del Fascicolo/Dossier sanitario, rivolgendo qualsiasi istanza alla Direzione Sanitaria di Struttura c/o l&rsquo;indirizzo del Titolare, ricordiamo che il consenso all&rsquo;implementazione del Fascicolo/Dossier da lei manifestato nonch&eacute; la richiesta di oscuramento di taluni eventi clinici sono in qualunque momento revocabili. A tal fine potr&agrave; utilizzare la modulistica presente in Struttura ovvero far pervenire sempre all&rsquo;attenzione del Direttore Sanitario c/o l&rsquo;indirizzo del Titolare formale istanza di revoca debitamente sottoscritta. La informiamo, da ultimo, che &egrave; suo diritto procedere in qualsiasi momento alla consultazione del Fascicolo/Dossier, che Le verr&agrave; garantita nei limiti della presa visione di un report riassuntivo degli eventi clinici occorsi durante i vari episodi di ricovero. A tal fine potr&agrave; presentare espressa richiesta da formulare per iscritto e indirizzare all&rsquo;attenzione del Direttore Sanitario della Struttura c/o il recapito del Titolare del trattamento.</p>\r\n<h2>Conservazione dei dati</h2>\r\n<p>I dati verranno conservati per un periodo non superiore a quello necessario per adempiere agli obblighi di legge o ai compiti necessari al perseguimento delle finalit&agrave; per cui i dati stessi sono trattati, in particolare i dati relativi alle prestazione sanitarie a lei rese e comunque trattati per le finalit&agrave; di cui ai punti 1 a 5 (del paragrafo Finalit&agrave; del trattamento) saranno conservati per il tempo stabilito dalla vigente normativa in materia e in ogni caso per il tempo necessario a garantire l&rsquo;eventuale tutela della struttura in tema di responsabilit&agrave; sanitaria per quanto concerne i dati relativi alle prestazioni sanitarie a lei rese. Per le attivit&agrave; di ricerca scientifica, statistica, e per i trattamenti dati ai fini statistico-epidemiologici con relativo follow-up per finalit&agrave; statistica e di conoscenza scientifica i dati saranno conservati per il tempo necessario alla conclusione della ricerca e in ogni caso per un periodo non superiore a cinque anni. Decorsi i periodi di conservazione sopra indicati i dati saranno cancellati o in ogni caso resi definitivamente anonimi.</p>\r\n<h2>Comunicazione dei dati</h2>\r\n<p>La comunicazione di dati idonei a rivelare lo stato di salute avverr&agrave; direttamente all&rsquo;interessato o a suo delegato con&nbsp;mezzi idonei a prevenire la conoscenza da parte di soggetti non autorizzati. I dati sanitari potranno essere comunicati nei limiti strettamente pertinenti agli obblighi, ai compiti e alle finalit&agrave; del trattamento, alle seguenti categorie di soggetti che svolgono attivit&agrave; connesse o strumentali alla prestazione dei servizi e/o allo svolgimento delle attivit&agrave; del medico e potranno essere dai medesimi soggetti conosciuti in qualit&agrave; di Titolari o Responsabili del trattamento: determinati soggetti terzi, secondo quanto dispongono le norme di legge vigenti e secondo quanto prevedono i rapporti contrattuali in essere con la Societ&agrave; Star 9000, al fine di consentire l&rsquo;adempimento di obblighi di legge e la pi&ugrave; efficiente erogazione delle prestazioni sanitarie richieste. In forza delle leggi vigenti, i dati anagrafici, le terapie e le cure praticate, la diagnosi di dimissione con la relativa scheda di dimissione ospedaliera e quant&rsquo;altro necessario, potrebbero essere comunicati, per quanto di competenza, all&rsquo;Azienda/Unit&agrave; Sanitaria Locale e alle Autorit&agrave; di pubblica sicurezza; per esigenze aziendali connesse all&rsquo;anagrafe dei clienti e per esigenze di corretta gestione amministrativa e contabile, i dati anagrafici, fiscali e sanitari,&nbsp;ivi compresa la trasmissione di copia della cartella clinica (questi ultimi nei limiti necessari per la corretta elaborazione contabile e per il pagamento delle prestazioni sanitarie a lei erogate), saranno comunicati a professionisti terzi del settore medico da lei espressamente delegati; per il conseguimento del pagamento delle prestazioni sanitarie erogate, i dati anagrafici, fiscali e sanitari, ivi compresa copia della cartella clinica, saranno comunicati agli enti competenti del SSN e/o agli altri enti da lei eventualmente indicati (Compagnie Assicurative, Associazioni, Enti,&nbsp;Mutue Integrative, etc.); a fornitori di protesi al fine di attivare la prevista garanzia di perfetto funzionamento del dispositivo impiantato, a fornitori di servizi di assistenza e manutenzione su attrezzature scientifiche e sistemi informatici al solo fine di garantire un adeguato supporto tecnico e on line sugli stessi (es.: per individuare e correggere errori e guasti e per aggiornare i sistemi, etc.); alla compagnia assicurativa dell&rsquo;Azienda per la tutela della stessa e dei suoi operatori, per le ipotesi di responsabilit&agrave;; all&rsquo;Autorit&agrave; Giudiziaria e/o all&rsquo;Autorit&agrave; di Pubblica Sicurezza, nei casi espressamente previsti dalla legge. I dati idonei a rivelare lo stato di salute non saranno diffusi, cio&egrave; divulgati al pubblico e/o ad un numero indeterminato di destinatari.Tutte le informazioni relative al suo stato di salute saranno comunicate a lei ed ai suoi familiari soltanto per il tramite del personale medico addetto alle sue cure, ovvero di altro medico da quest&rsquo;ultimo incaricato. Per ogni altra questione relativa alla tutela dei suoi dati personali potr&agrave; invece rivolgersi direttamente al Titolare per il trattamento dei dati personali della struttura o al Responsabile interno trattamento dati.</p>\r\n<h2>Trasferimenti dati all&rsquo;estero</h2>\r\n<p>La gestione e la conservazione dei dati avviene su server del titolare di societ&agrave; terze nominate responsabili esterni del trattamento. Tali server sono ubicati presso il titolare in Italia e comunque all&rsquo;interno dell&rsquo;Unione Europea. I dati personali non sono oggetto di trasferimento all&rsquo;esterno dell&rsquo;Unione Europea, in ogni caso resta inteso che ove si rendesse necessario, il titolare potr&agrave; trasferire dati personali anche in Paesi Extra UE garantendo sin d&rsquo;ora che il trasferimento dei dati personali avverr&agrave; nel rispetto delle disposizioni di legge applicabili, quindi stipulando, se ed in quanto necessario, specifici accordi che garantiscano un livello di protezione adeguato dei dati personali o comunque adottando le clausole contrattuali standard previste dalla Commissione Europea per il trasferimento dei dati extra UE.</p>\r\n<h2>Diritti dell&rsquo;interessato</h2>\r\n<p>Nella sua qualit&agrave; di interessato, ha i diritti di cui all&rsquo;art. 15 GDPR e precisamente i diritti di: ottenere la conferma dell&rsquo;esistenza o meno di dati personali che la riguardano, anche se non ancora registrati, e la loro comunicazione in forma intelligibile; ottenere l&rsquo;indicazione: a) dell&rsquo;origine dei dati personali; b) delle finalit&agrave; e modalit&agrave; del trattamento; c) della logica applicata in caso di trattamento effettuato con l&rsquo;ausilio di strumenti elettronici; d) degli estremi identificativi del titolare, dei responsabili e del rappresentante designato ai sensi dell&rsquo;art. 3, comma 1, GDPR; e) dei soggetti o delle categorie di soggetti ai quali i dati personali possono essere comunicati o che possono venirne a conoscenza in qualit&agrave; di rappresentante designato nel territorio dello Stato, di responsabili o incaricati; ottenere: a) l&rsquo;aggiornamento, la rettificazione ovvero, quando vi ha interesse, l&rsquo;integrazione dei dati; b) la cancellazione, la trasformazione in forma anonima o il blocco dei dati trattati in violazione di legge, compresi quelli di cui non &egrave; necessaria la conservazione in relazione agli scopi per i quali i dati sono stati raccolti o successivamente trattati; c) l&rsquo;attestazione che le operazioni di cui alle lettere a) e b) sono state portate a conoscenza, anche per quanto riguarda il loro contenuto, di coloro ai quali i dati sono stati comunicati o diffusi, eccettuato il caso in cui tale adempimento si rivela impossibile o comporta un impiego di mezzi manifestamente sproporzionato rispetto al diritto tutelato; opporsi, in tutto o in parte, per motivi legittimi al trattamento dei dati personali che la riguardano, ancorch&eacute; pertinenti allo scopo della raccolta; Ove applicabili, ha altres&igrave; i diritti di cui agli artt. 16-20 GDPR (Diritto di rettifica, diritto all&rsquo;oblio, diritto di limitazione di trattamento, diritto alla portabilit&agrave; dei dati), nonch&eacute; il diritto di reclamo all&rsquo;Autorit&agrave; Garante. In qualsiasi momento lei potr&agrave; esercitare i suoi diritti rivolgendosi direttamente ai riferimenti indicati nella sezione &ldquo;Dati identificativi&rdquo;.</p>\r\n<h2>Consenso dell&rsquo;interessato</h2>\r\n<p>Letta la presente informativa, il/la sottoscritto/a dichiara di averne compreso il contenuto e di prestare il proprio consenso al trattamento dei dati personali finalizzato all&rsquo; esecuzione delle prestazioni oggetto del servizio erogato.Il/La sottoscritto/a dichiara inoltre di prestare il proprio specifico consenso scritto al trattamento dei dati per le seguenti ulteriori finalit&agrave;:</p>', '2019-09-06 07:17:15', '2019-12-18 12:42:10');
